the chain construct is one of SUS' unique features. Not yet implemented. Often it is needed to have some kind of priority encoding in hardware. It only fires the first time it is valid. As a bit of syntactic sugar, the first statement uses a chain to check if it's the first time the condition was valid. It comes in two variants: standalone first and if first. Examples module first_enabled_bit { interface first_enabled_bit : bool[10] values -> bool[10] is_first_bit chain bool found = false for int i in 0..10 { if values[i] { first in found { // First i for which values[i]==true is_first_bit[i] = true } else { // values[i]==true but not the first is_first_bit[i] = false } } else { // values[i]!=true is_first_bit[i] = false } }
} With if first we can merge both else blocks. module first_enabled_bit { interface first_enabled_bit : bool[10] values -> bool[10] is_first_bit chain bool found = false for int i in 0..10 { if first values[i] in found { // First i for which values[i]==true is_first_bit[i] = true } else { // values[i]!=true or not first values[i]==true is_first_bit[i] = false } }
} Often with uses of first one also wants to have a case where the condition never was valid. module first_enabled_bit_index { interface first_enabled_bit_index : bool[10] values -> int first_bit, bool all_zero chain bool found = false for int i in 0..10 { if first values[i] in found { first_bit = i all_zero = false } } if !found { all_zero = true }
}

