Sadly, while it appears reasonable to think it's possible to assign a determinable latency. Observe this contrived example: module NonDeterminableLatency { interface NonDeterminableLatency : int a, int b -> int x, int y reg int a_d = a int t = a_d + b reg reg reg int a_dd = a reg int t_d = t x = t_d + a_dd y = t
} Simplified latency graph: Non Uniquely Determinable Example The issue starts when the inputs and outputs don't have predefined absolute latency. We are tempted to add maximization and minimization to the input and output absolute latencies, to force the module's latency span to be as compact as possible, and therefore maximize how free the user of this module is in using it. But sadly, we cannot make a uniquely determinable latency assignment for our inputs and outputs, as in this example b and y press against each other, permitting two possible implementations. One may think the solution would simply be to prefer inputs over outputs or something, just to get a unique latency assignment. Just move b to be the earliest of the available latencies, but even in this case, if we instead looked at the possibilities of a, and fixed b, we would again make b later by making a earlier. And since there's no way to distinguish meaningfully between inputs, there's no uniquely determinable solution either. To this problem I only really see three options: Still perform full latency computation when compiling each module separately. In the case of non-determinable latency assignment, reject the code and require the programmer to add explicit latency annotations. The benefit is better encapsulation, the programmer requires only the module itself to know what latencies are. The downside is of course less flexible modules. Though is this flexibility really needed? Infer absolute latencies on the inputs and outputs of submodules using templates which can be inferred. This would be really handy to allow latency information to flow back into the templating system, thus allowing a FIFO that alters its almostFull threshold based on its input latency. Of course, this makes absolute latency information flow from top-down instead of bottom up, so now getting the latency information back from the module would be impossible. The issue is that templates can't be instantiated partially. Either the submodule takes all of its port latencies from the calling module, or it determines its latencies itself Perform latency computation at integration level, we don't define the absolute latencies on the ports of a module, unless the programmer explicitly does so. For simlpicity, this requires that every single module instantiation now compiles to its own Verilog module though, which is less than ideal for debugging Simply solve the above module by explicitly specifying latencies to the two inputs: module LatencySpecified { interface LatencySpecified : int a'0, int b'1 -> int x, int y reg int a_d = a int t = a_d + b reg reg reg int a_dd = a reg int t_d = t x = t_d + a_dd y = t
}

