module Accumulator { interface Accumulator : int term, bool done -> int total state int tot := 0 // Initial value, not a real assignment int new_tot = tot + term if done { total = new_tot tot = 0 finish // packet is hereby finished. } else { tot = new_tot }
} In this case the compiler would generate a state machine with two states. One state for when the module is active, and one is generated implicitly for the inactive case. The regex is mapped to a 3-state state machine. Represented below: A: inactive B: (X, false - /) C: (X, true - T) The regex produces the following NFA: (-> is a consuming transition, => is not) A -> A when !valid A => B when valid B -> B when !done B => C when done C -> A Compiled to a DFA this gives: A -> A when !valid A -> B when valid & !done A -> C when valid & done B -> B when !done B -> C when done C -> A when !valid C -> B when valid & !done C -> C when valid & done The code's state machine must be proven equivalent to the regex state machine. This is done by simulating the code STM based on the regex. The code must properly request inputs at regex states where inputs are provided, and may not when not. It's inputs must be valid for any path in the regex STM, while it's outputs must conform to some path of the regex. Any module working on finite packet sizes must also specify the finish keyword when the module is finished sending a packet. At this point the initial conditions must be reestablished explicitly. After this, the module goes back into the inactive state. In this example, the code simulation starts right in its initial state. Then the different paths of the regex STM are all simulated. For the case of infinite loops, we save any distinct (regex, code-STM) pair we come across, and skip combinations we've already come across. Since in this example the only active state for the code corresponds to both active states of the regex, the code must abide by the constraints of both regex paths. And it does, in the case done == false the module may not output total Likewise, in the case done == true, the module must output total. And in the case of done == true, the code has to go back to the initial state through the finish keyword. The caller is then responsible for providing a stream of the form of the regex.

