module Unpack4<T> { interface Unpack4 : T[4] packed -> T out_stream state int st := 0 // Initial value, not a real assignment state T[3] stored_packed if st == 0 { out_stream = packed[0] stored_packed[0] = packed[1] // Shorthand notation is possible here "stored_packed[0:2] = packed[1:3]" stored_packed[1] = packed[2] stored_packed[2] = packed[3] st = 1 } else if st == 1 { out_stream = stored_packed[0] st = 2 } else if st == 2 { out_stream = stored_packed[1] st = 3 } else if st == 3 { out_stream = stored_packed[2] st = 0 finish // packet is hereby finished. }
} In this case, the regex has 4 states, but we don't know what number of states the code has. One could bound the integer st of course, and for the number of states multiply together the counts of all structural state objects we find. But we don't need to. We can simply simulate the code, only explicitly saving the structural state fields. In this case, we know the starting value of st, and we just need to simulate the hardware with this. So in the first cycle, we are obligated to read from packed, and write to out_stream. Following the code that is the case, as we execute the first branch: st == 0. We know the next state st = 1, so we continue going along. This continues for the remaining states of the regex, ending at st == 3 where we also call finish.

