In SUS there's quite a few things that come together that make this notation of templates difficult. For starters, SUS also has the < > comparison operators, which provides an immediate conflict, just like in the above example. Another less well known conflict from this notation comes from the commas. Take calling: myFunc(choice<3, 6>(5), x, y, z); If the parser interprets the < as a comparison, then the commas separate function arguments, but if it were to interpret them as a template then the first comma separates template arguments. What's more, SUS has a few extra notations that also conflict with this idea, namely multiple value declarations, which are used for functions that return multiple values. To illustrate: int b;
int[5] c;
int a, b, c[0], myType<int, bool> d = myFuncReturningFourResults(); Where the intent is to assign to a newly declared a, an existing variable b, indexing into array c, and a new variable d. This notation combines declarations with assignable expressions. The issue is that if the compiler can accept both declarations and arbitrary expressions, then there's two perfectly valid parses for d. Either the one we intend, or it becomes two expressions myType<int and bool> d. While it may seem a bit dumb to assign to the output of a comparison operator to the parser it's all _expression.
